import "./App.css";
 import React from 'react';
 import { Routes, Route, Link } from "react-router-dom";
 import Mercury from "./components/Mercury";


 function App() {
     return (
         <div>

         <Link to="/mercury">Mercury</Link>
             hello
             <Routes>
             <Route exact path="/mercury" render={(props) => <Mercury />}/>

             </Routes>
         </div>
     );
 }

 export default App;
